import Dropdown from 'react-bootstrap/Dropdown';
import DropdownButton from 'react-bootstrap/DropdownButton';

class CalculateCommission extends Component {
  constructor(props) {
    super(props);
    this.state = {
      columns: [{ "header": "ID", "name": "Resource Manager" },
      { "header": "NAME", "name": "name" },
      { "header": "Start Date", "name": "startDate" },
      { "header": "End Date", "name": "endDate" }],
      showCC: true,
      resourceName: null,
      startDate: null,
      endDate: null
    }
    this.handleOnChange = this.handleOnChange.bind(this);
    this.handleClose = this.handleClose.bind(this);
  }

  handleClose(event) {
    this.setState({
      showCC: false
    })
  }

  handleOnChange = (event) => {
    debugger
    console.log("line 88", event.target.value);
    let obj = {}

    obj[event.target.id] = event.target.value;

    this.setState({

      ...this.state.startDate,

      ...this.state.endDate,

      ...obj


    })

    console.log("onchange =? obj => ", obj)
    console.log('this.state => ', this.state)

  }



  render() {
    console.log("props--------", this.props);
    console.log("line 314", this.state);
    return (
      <div>
          <DropdownButton id="dropdown-basic" title="Dropdown button">
                {this.state.data.map((row, index)  =>
                  <tr>
                    <Dropdown.Item>{this.state.data[index].name}</Dropdown.Item>
                  </tr>
                )}
            </DropdownButton>

        <Modal show={this.state.showRM} onHide={this.handleClose}>
          <Modal.Header>
            <Modal.Title>Update Resource Manager</Modal.Title>
          </Modal.Header>
          <form onSubmit={this.handleSubmitUpdate}>
            <Modal.Body>
              <br />
              <label For="id">ID</label>
              <br />
              <label For="id" >{this.state.id}</label>
              <br />
              <label For="name">Name</label>
              <input id="name" name="name" type="text" onChange={this.handleOnChange} value={this.state.name} />
              <label for="startDate">Start Date</label>
              <input type="date" id="startDate" onChange={this.handleOnChange} value={this.state.startDate} />
              <label For="endDate">End Date</label>
              <input type="date" id="endDate" onChange={this.handleOnChange} value={this.state.endDate} />
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={this.handleClose}>
                Close
                </Button>
              <Button type="submit" variant="primary" >
                Submit
                </Button>
            </Modal.Footer>
          </form>
        </Modal>




      </div>
    );
  }
}

export default CalculateCommission;
